import React, { Component } from "react";

class component1 extends Component {
  state = {
    count: 1,
  };
  render() {
    return (
      <React.Fragment>
        <span>{func()}</span>
        <button> press here</button>
      </React.Fragment>
    );
  }
  func() {
    return (
      <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pexels.com%2Fphoto%2Fblack-dslr-camera-with-black-background-1251299%2F&psig=AOvVaw3SRlztYJ5w1N86sNwXGuPe&ust=1586347134137000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKD10N2h1ugCFQAAAAAdAAAAABAD"></img>
    );
  }
}

export default component1;
